import { Link } from 'react-router-dom';
import '../css/Home.css';

const Home = () => {
  return (
    <div className="home-container">
      {/* Background Elements */}
      <div className="background-pattern"></div>
      <div className="gradient-overlay"></div>

      {/* Hero Section */}
      <section className="hero-section">
        <h1 className="hero-title">DSA MASTERY.</h1>
        <p className="hero-subtitle">Reimagine the way you learn algorithms</p>
        <p className="hero-description">
          Curated learning paths delivered through interactive content, designed to help you
          <br />
          conquer coding interviews and master complex concepts.
        </p>

        <div className="cta-container">
          <Link to="/learning-path" className="cta-button">
            BEGIN YOUR JOURNEY
          </Link>
        </div>
      </section>

      {/* Process Section */}
      <section className="process-section">
        <h2 className="section-title">THE LEARNING PATH</h2>
        <div className="process-steps">
          <div className="process-card">
            <div className="step-number">01</div>
            <h3>Foundation First</h3>
            <p>Master basic data structures and time complexity analysis</p>
          </div>

          <div className="process-card">
            <div className="step-number">02</div>
            <h3>Advanced Patterns</h3>
            <p>Learn recursion, dynamic programming, and graph algorithms</p>
          </div>

          <div className="process-card">
            <div className="step-number">03</div>
            <h3>Real-World Practice</h3>
            <p>Solve curated problems from FAANG interviews</p>
          </div>
        </div>
      </section>
    </div>
  );
};

export default Home;
